import React from "react";

import "./TravelMainPage.css";

const TravelMainPage = () => {

    useEffect(() => {
        document.title = "Все сервисы Яндекса";
    }, []);

    return (
        <div id="travel-main">
            <h4>TRAVEL PAGE</h4>
        </div>
    );
}

export default TravelMainPage;
